(() => {
  const norm = (s) => (s || '').trim().toLowerCase().replace(/\s+/g, ' ');
  // Parser angka yang tahan format lokal (1,234.56 atau 1.234,56)
  const parseLocaleNumber = (raw) => {
    if (raw == null) return 0;
    let t = String(raw).trim();
    if (!t) return 0;
    // Simpan hanya digit, pemisah, tanda minus/kurung
    t = t.replace(/[^0-9.,()\-]/g, '');
    if (!t) return 0;
    // Dukungan angka negatif dengan tanda kurung atau minus
    let negative = false;
    if (t.startsWith('(') && t.endsWith(')')) { negative = true; t = t.slice(1, -1); }
    if (t.startsWith('-')) { negative = true; t = t.slice(1); }
    const lastComma = t.lastIndexOf(',');
    const lastDot = t.lastIndexOf('.');
    if (lastComma >= 0 && lastDot >= 0) {
      const lastSepIndex = Math.max(lastComma, lastDot);
      const lastSepChar = t[lastSepIndex];
      const fractional = t.slice(lastSepIndex + 1);
      const isDecimalLike = fractional.length > 0 && fractional.length <= 3;
      if (lastSepChar === '.' && isDecimalLike) {
        // Gaya US: koma ribuan, titik desimal
        t = t.replace(/,/g, '');
      } else if (lastSepChar === ',' && isDecimalLike) {
        // Gaya ID/EU: titik ribuan, koma desimal
        t = t.replace(/\./g, '').replace(/,/g, '.');
      } else {
        // Fallback: hitung jumlah pemisah
        const dotCount = (t.match(/\./g) || []).length;
        const commaCount = (t.match(/,/g) || []).length;
        if (dotCount > commaCount) {
          t = t.replace(/\./g, '').replace(/,/g, '.');
        } else {
          t = t.replace(/,/g, '');
        }
      }
    } else if (lastComma >= 0) {
      const frac = t.slice(lastComma + 1);
      if (frac.length > 0 && frac.length <= 3) {
        t = t.replace(',', '.');
      } else {
        t = t.replace(/,/g, '');
      }
    } else if (lastDot >= 0) {
      const frac = t.slice(lastDot + 1);
      if (frac.length > 0 && frac.length <= 3) {
        // pertahankan titik sebagai desimal
      } else {
        t = t.replace(/\./g, '');
      }
    }
    const n = parseFloat(t);
    if (isNaN(n)) return 0;
    return negative ? -n : n;
  };

  function findTargetTable() {
    const tables = Array.from(document.querySelectorAll('table'));
    let best = null;
    let bestScore = -1;
    const score = (t) => {
      const hs = Array.from(t.querySelectorAll('thead th, thead td')).map(el => norm(el.innerText || el.textContent));
      let sc = 0;
      if (hs.length > 5) sc += 1;
      if (hs.includes('username')) sc += 3;
      if (hs.some(h => h.includes('first deposit'))) sc += 2;
      if (hs.some(h => h.includes('last login'))) sc += 2;
      if (hs.some(h => h.includes('to slot') || h.includes('to slot') || h.includes('turn over slot') || h.includes('turnover slot') || h.includes('slot turnover') || h.includes('to slots') || h.includes('to-slot') || h.includes('to slots'))) sc += 5;
      if (hs.some(h => h.includes('to casino') || h.includes('live casino') || h.includes('turnover casino') || h.includes('turn over casino') || h.includes('casino'))) sc += 4;
      return sc;
    };
    for (const t of tables) {
      const sc = score(t);
      if (sc > bestScore) { bestScore = sc; best = t; }
    }
    return best;
  }

  function headerIndexMap(table) {
    const ths = Array.from(table.querySelectorAll('thead th, thead td')).map(el => (el.innerText || el.textContent || '').trim());
    const findIdx = (names) => {
      const list = Array.isArray(names) ? names : [names];
      const thsNorm = ths.map(norm);
      for (const n of list) {
        const idx = thsNorm.findIndex(h => h.includes(norm(n)));
        if (idx >= 0) return idx;
      }
      return -1;
    };
    return {
      refid: findIdx(['refid','ref id','agent id']),
      username: findIdx('username'),
      acc_name: findIdx(['acc name','account name','account','name']),
      last_login_ip: findIdx(['last login ip', 'last login']),
      ip_register: findIdx(['ip register','register ip']),
      to_slot: findIdx(['to slot','to slots','turn over slot','turnover slot','slot turnover','to-slots','to slot']),
      to_casino: findIdx(['to casino','live casino','turn over casino','turnover casino','casino turnover']),
    };
  }

  function readCellText(td) {
    if (!td) return '';
    let txt = (td.innerText || td.textContent || '').trim();
    if (!txt) {
      const a = td.querySelector('a');
      if (a) txt = (a.innerText || a.textContent || '').trim() || (a.getAttribute('href') || '');
    }
    return txt;
  }

  function extractRows(table) {
    const idx = headerIndexMap(table);
    const rows = Array.from(table.querySelectorAll('tbody tr'));
    return rows.map(tr => {
      const tds = Array.from(tr.querySelectorAll('td'));
      const pick = (i) => (i >= 0 && i < tds.length ? readCellText(tds[i]) : '');
      const username = pick(idx.username);
      const refid = pick(idx.refid);
      const accName = pick(idx.acc_name);
      const slotText = pick(idx.to_slot);
      const casinoText = pick(idx.to_casino);
      return {
        refid,
        username,
        acc_name: accName,
        last_login_ip: pick(idx.last_login_ip),
        ip_register: pick(idx.ip_register),
        to_slot: slotText,
        to_slot_num: parseLocaleNumber(slotText),
        to_casino: casinoText,
        to_casino_num: parseLocaleNumber(casinoText),
      };
    });
  }

  function attachGlobal() {
    const api = {
      extract() {
        const table = findTargetTable();
        if (!table) return { ok: false, error: 'table-not-found' };
        const items = extractRows(table);
        return { ok: true, count: items.length, items };
      }
    };
    try { window.AppCheckerScraper = api; } catch (_) {}
    return api;
  }

  function initMessaging(api) {
    try {
      chrome.runtime?.onMessage?.addListener((msg, sender, sendResponse) => {
        if (msg && msg.type === 'scrapeCheckerTable') {
          const out = api.extract();
          sendResponse(out);
          return true;
        }
      });
    } catch (_) {}
  }

  function autolog() {
    // Hanya log jika halaman mengandung teks "App Checker" untuk menghindari bising di halaman lain
    const hasTitle = /App Checker/i.test(document.body?.innerText || '') || /Checker App/i.test(document.title || '');
    if (!hasTitle) return;
    const table = findTargetTable();
    const idx = table ? headerIndexMap(table) : null;
    const out = attachGlobal().extract();
    // Log singkat agar dev bisa melihat apakah TO sudah terbaca
    if (out.ok) {
      const preview = out.items.slice(0, 3).map(x => ({ user: x.username, to_slot: x.to_slot, to_slot_num: x.to_slot_num, to_casino: x.to_casino, to_casino_num: x.to_casino_num }));
      console.info('[Checker-2.5.0] Preview TO:', preview);
      if (idx) {
        console.info('[Checker-2.5.0] Header index map:', idx);
      }
    } else {
      console.warn('[Checker-2.5.0] Tidak menemukan tabel target:', out.error);
    }
  }

  const api = attachGlobal();
  initMessaging(api);
  // Jalankan otomatis setelah load
  if (document.readyState === 'complete' || document.readyState === 'interactive') {
    autolog();
  } else {
    window.addEventListener('DOMContentLoaded', autolog);
  }
})();

