  // Observer global: deteksi penggantian tabel / render ulang MUI dan re-attach
  function observeTableLifecycle() {
    try {
      const root = document.body;
      if (!root || root.__checkerLifecycleObserved) return;
      root.__checkerLifecycleObserved = true;
      let lastTbl = null;
      let debounceTimer = null;
      const debouncedApply = () => {
        clearTimeout(debounceTimer);
        debounceTimer = setTimeout(() => {
          const t = findCheckerTable();
          const r = getCheckerDateRangeFromPage();
          if (t) attachTableObserver();
          if (t && r.startDate && r.endDate) {
            filterCheckerTableByDateRange(t, r.startDate, r.endDate);
          }
          injectCopyButton();
        }, 250);
      };
      const obs = new MutationObserver(() => {
        const cur = findCheckerTable();
        if (cur && cur !== lastTbl) {
          lastTbl = cur;
          attachTableObserver();
        }
        debouncedApply();
      });
      obs.observe(root, { childList: true, subtree: true });
    } catch (_) {}
  }

  async function scrapeWinLoseMerge({ refId, categories = ['SLOT', 'LIVE CASINO'], concurrency = 1, startDate, endDate } = {}) {
    const table = findCheckerTable();
    if (!table) return { ok: false, error: 'checker-table-not-found' };
    const idIdx = getCheckerIdIndex(table);
    const toIdx = getCheckerToIndices(table);
    // Ambil rentang tanggal dari halaman jika belum disediakan
    if (!startDate || !endDate) {
      const rng = getCheckerDateRangeFromPage();
      startDate = startDate || rng.startDate;
      endDate = endDate || rng.endDate;
    }
    const rows = Array.from(table.querySelectorAll('tbody tr')).map(tr => {
      const tds = Array.from(tr.querySelectorAll('td'));
      const idText = idIdx >= 0 ? (tds[idIdx]?.innerText || tds[idIdx]?.textContent || '').trim() : '';
      return { id: idText, tds };
    }).filter(r => r.id);

    // Ambil map dari Win/Lose per kategori
    const maps = {};
    for (const cat of categories) {
      const res = await openWinLoseAndScrape({ categoryText: cat, refId, startDate, endDate });
      maps[cat] = res.ok ? res.map : {};
    }

    // Gabungkan
    const items = rows.map(r => {
      const slot = (maps['SLOT'] && maps['SLOT'][r.id]) || 0;
      const casino = (maps['LIVE CASINO'] && maps['LIVE CASINO'][r.id]) || 0;
      // Tulis kembali ke tabel jika kolomnya ada
      if (toIdx.slot >= 0 && r.tds[toIdx.slot]) { r.tds[toIdx.slot].innerText = formatCurrency(slot); }
      if (toIdx.casino >= 0 && r.tds[toIdx.casino]) { r.tds[toIdx.casino].innerText = formatCurrency(casino); }
      return { id: r.id, to_slot_num: slot, to_casino_num: casino };
    });
    // Logging ringkas agar mudah verifikasi
    try {
      const preview = items.slice(0, 3);
      console.info('[Checker-2.5.0] Win/Lose merge preview:', preview);
    } catch (_) {}
    // Terapkan filter tanggal lokal pada tabel agar jumlah baris sesuai periode
    try { filterCheckerTableByDateRange(table, startDate, endDate); } catch (_) {}
    return { ok: true, count: items.length, items };
  }

